import React from "react";

<FontAwesomeIcon icon="fa-solid fa-droplet" />;

import Currentdate from "./Currentdate";
import WeatherIcon from "./WeatherIcon";
import WeatherTemperature from "./WeatherTemperature";
import "./Weather.css";

export default function DetailedWeatherInfo(props){
    return (
      <div className="Detailed-Weather-Info mt-5">
        <p>Weather Details</p>
        <div className="d-flex">
          <div className="detailed-conditions me-5">
            <div>Pressure</div> <div>{props.info.pressure} MPa</div>
          </div>

          <div className="detailed-conditions">
            <div>Humidity</div> <div> {props.info.humidity} %</div>
          </div>
        </div>
        <div className="d-flex">
          <div className="detailed-conditions me-5 mt-4">
            <div>Wind</div>
            <div> {props.info.wind} km/h</div>
          </div>

          <div className="detailed-conditions mt-4 px-3">
            <div>Visibility</div>
            <div> {props.info.visibility} km</div>
          </div>
        </div>
      </div>
    );
}
